module.exports=`<h1>1.系统概述</h1><h2>1.1系统用途</h2><p><span>本系统在湖南煤矿安全监察局煤矿事故风险分析平台内增加智慧型煤炭矿山模块，使其具有三维功能。用户在登录此平台后即可观看到立体、生动的矿井地质和煤层特征，采掘和安全生产态势，避灾和救护系统。为煤矿地质分析、探采方案确定、安全生产保障和避灾救护提供技术支持；为非地质采矿专业的技术人员提供专业交流指导；为技术交流汇报和领导决策提供帮助。</span></p><p><span>（湖南煤矿安全监察局煤矿事故风险分析平台）</span><br><br><span>（智慧型煤炭矿山）</span><b></b><i></i><u></u><sub></sub><sup></sup><strike></strike><br></p><h2>1.2系统开发环境</h2><span>智慧型煤炭矿山系统在微软提供的Visual Studio Code环境下利用Vue.js进行系统前端的开发，后台使用Java进行开发，运用其平台上的开源应用框架--Spring Boot搭建后台框架。数据库使用MySQL将数据保存在不同表中，增加数据管理的速度，提高灵活性。</span><p><br></p><h2>1.3系统运行</h2><p><span>本软件运行在PC 及其兼容机上，使用Windows 操作系统，在登陆湖南煤矿安全监察局煤矿事故风险分析平台后，点击相应图标即可访问相应煤矿并进行编辑等操作。</span><b></b><i></i><u></u><sub></sub><sup></sup><strike></strike><br></p><h2>1.4系统配置</h2><p><span>智慧型煤炭矿山系统此系统需要有Windows XP或Win7或以上操作系统环境。</span><b></b><i></i><u></u><sub></sub><sup></sup><strike></strike><br></p><h1>2.系统总体设计</h1><h2>2.1技术路线</h2><p><span>系统开发研究的技术路线见下图：</span></p><p><img style="max-width:100%;" src="data:image/jpeg;base64,"><b></b><i></i><u></u><sub></sub><sup></sup><strike></strike><br></p><h2>2.2系统的主要目标</h2><p><span>1、利用3D技术，实现对煤矿的三维可视化虚拟，进行虚实结合的三维场景再现。</span><br><span>2、利用3D建模技术，实现矿井采掘生产系统三维可视化虚拟。</span><br><span>3、立体（准实时）地远程监控煤矿安全生产态势和避灾救护系统实况。</span><br><span>4、实现矿井地质灾害救护所需要的支持信息立体展示：事故点地质情况和巷道特征，地表救护方案信息显示。 </span><b></b><i></i><u></u><sub></sub><sup></sup><strike></strike><br></p><h2>2.3系统的技术要求</h2><span>系统完成后应该达到的技术目标：</span><br><span>1、完成系统总体平台，实现地表、煤层、断层、工作面、巷道系统的三维动态操作与查询。</span><br><span>2、实现矿山人员定位，实现井下人员分区显示查询功能，报警功能和人员活动轨迹三维显示功能。</span><br><span>3、实现实时监控监测，主要包括实时监控监测和实时报警监测。(分类监测数据)</span><br><span>4、实现应急救援管理功能，包括历史事故访问、救援方案管理、巷道淹没分析、事故模拟以及钻探救援分析。</span><br><span>5、实现对机械管理及井下电话管理。</span><br><span>6、实现可查询避灾路径，进行最短路径分析。</span><br><span>7、实现各类查询和分析工具类功能：屏幕录制、井下通风系统、测量工具、坐标转换、属性查询、名称查询、坐标查询、网站链接、煤层等高线10米、20米。</span><p><br></p><h1>3.项目组织与实施</h1><h2>3.1项目组织机构<br></h2><p><span>    湖南省煤矿安全监察局领导高度重视煤矿安全问题。为更好的对煤矿事故进行风险分析，由湖南中科新域科技有限公司开发“湖南煤矿安全监察局煤矿事故风险分析平台”，其中“智慧型煤炭矿山系统”由中国矿业大学（北京）进行开发。</span><br><span>3.1.2项目承担单位</span><br><span>智慧型煤炭矿山系统建设由项目由湖南中科新域科技有限公司对具体实施单位进行指导，由中国矿业大学（北京）进行具体实施。</span><br><span>3.1.3项目分工</span><br><span>领导小组</span><br><br><span>湖南中科新域科技有限公司</span><br><br><span>3）中国矿业大学（北京）</span><br><span>1.     制定项目建设方案。</span><br><span>2. 开发完成系统建设。</span><br><span>3. 制作项目相关各种文档。</span><br><span>（待完善）</span><br><br><br></p><h2>3.2项目实施</h2><h3>3.2.1项目实施过程</h3><span>智慧型煤炭矿山系统是一个煤矿三维可视化系统，该系统涉及数个煤矿模型,具体过程如下图：</span><p><img style="max-width:50%;" src="data:image/png;base64,"><b></b><i></i><u></u><sub></sub><sup></sup><strike></strike><br></p><h3>3.2.2项目进度</h3><span>3.2.2项目进度</span><br><span>（待完善）</span><p><br></p><h1>4.系统架构与功能</h1><h2>4.1系统架构</h2><span>本系统的基础架构包括两个部分，三层框架。两个部分为：核心部分与应用部分。其中，核心部分包括核心类库与框架层。三层框架为：核心类库层，三维框架层，应用层。</span><br><br><span>(待完善)</span><p><br></p><h2>4.2系统功能</h2><h1>5.系统的关键技术</h1><h2>5.1系统的快捷搭建</h2><span>项目时间紧、任务重，要完成包括前端、后端以及数据库的三个部分的建设。在完成这一系统工程过程中，我们从项目组织和具体实施上科学计划、严密实施，对项目的难点和重点进行了充分的分析，做好技术准备，保证按时保质保量地完成项目的建设。</span><p><br></p><h2>5.2前端关键技术</h2><span>项目前端采用Vue.js进行开发，三维效果使用Cesium（本系统坐标系：wgs84）进行样式渲染。其中1.地下模式:修改Cesium源码，调整白边，视角进入到地下直接返回地面的修改；2.巷道建模：运用cesium进行巷道模型构建；3.设备模型：使用sketchup构建三维模型，转为gltf格式导入cesium。页面设计使用iview制作。折线图使用百度旗下的ecahrts制作。</span><p><br></p><h2>5.3后端关键技术</h2><span>项目后端使用的编程语言为Java，运用其平台上的开源应用框架--Spring Boot搭建后台框架。</span><p><br></p><h2>5.4数据库</h2><span>数据库采用MySQL。它是一种关系型数据库管理系统，关系数据库将数据保存在不同的表中，而不是将所有数据放在一个大仓库内，这样就增加了速度并提高了灵活性。</span><br><span>前端和后台直接交互，前端将数据传输到后台，后台则与数据库直接关联，这样前端的数据即可通过后台传输到数据库；前端请求数据时，将请求发送到后台，后台再从数据库中调取数据传输到前端。</span><p><br></p><h1>6.系统使用规范</h1><p>（待完善）</p><h1>7.项目总结</h1><h2>7.1项目简介</h2><span>湖南煤矿安全监察局煤矿事故风险分析平台是由湖南中科新域科技有限公司及中国矿业大学（北京）共同负责，我校主要负责其平台的三维功能（智慧型煤炭矿山系统），目的立体、生动地展示煤矿特征，采掘和安全生产态势，避灾和救护系统，为煤矿地质分析、探采方案确定、安全生产保障和避灾救护提供技术支持，为非地质采矿专业的技术人员提供专业交流指导。为技术交流汇报和领导决策提供帮助。 </span><p><br></p><h2>7.2项目参数与人员开发时间</h2><span>我校项目参与人员共9人（含辅导老师），其中项目负责人、指导老师为郝多虎教授。</span><br><span>项目开发时间如下：</span><br><span>（待完善）</span><p><br></p><h2>7.3项目功能列表</h2><h2>7.4项目结构特点</h2><span>本系统的基础架构包括两个部分，三层框架。两个部分为：核心部分与应用部分。其中，核心部分包括核心类库与框架层。三层框架为：核心类库层，三维框架层，应用层。</span><br><span>（待完善）</span><p><br></p><h2>7.5技术特点</h2><span>本系统的的特点为前端采用Vue.js，一套用于构建用户界面的渐进式JavaScript框架。三维视图使用的Cesium是一个开源的，基于webgl的二、三维地图引擎，就其实现来说是目前开源版本中比较完备的一个版本，有完备的数据源支持、支持大场景、支持定制化的样式渲染。</span><p><br></p><h2>7.6对项目今后的建议</h2><span>进一步进行系统的开发，完善系统的功能，提高系统的可操作性，实用性。</span><br><p><br></p><p><br></p><p><br></p>`;
